import React from 'react';
import {TitleBlue, TitleRed} from "./Title";

const Alumno = () => {
    const alumnos = ["Andrea", "Aldo", "Abraham", "Pablo", "Alfredo"];
    
    return (
      <>
            <h1 className='titulo' style={{color: 'blueviolet'}}>Hola!</h1>
            
            <h3>Lista de alumnos</h3>
            <ul>
            {alumnos.map((nombre) => {return <li>{nombre}</li>})}
            </ul>
      </>
    )
  };

  export default Alumno;
